import { useState } from 'react';
import './WaitingPlayers.css';

function WaitingPlayers() {
    const [WaitingPlayers, setWaitingPlayers] = useState([]);

    function loadWaitingPlayers() {
        fetch('/findWaiting')
            .then(res => res.json())
            .then((result) => {
                setWinningSide(result['winner']);
            });
    }

    return (
        <div className="WaitingPlayers">
            <button onClick={() => loadWaitingPlayers()}>reload</button>
            <div className='WaitingPlayersTitle'>All Players</div>
            <div className='WaitingPlayersBody'></div>
        </div>
    );
};

export default WaitingPlayers;
